import React from 'react';

export default function Contact() {
  return (
    <div className="container contact">
      <h2>Contact</h2>
      <p>If you'd like to collaborate or see case studies, reach me on LinkedIn or send an email.</p>
      <p>
        <a href="mailto:your.email@example.com" className="btn btn-outline">Email</a>
        <a href="https://www.linkedin.com/in/priyadharshini2214" target="_blank" rel="noreferrer" className="btn">LinkedIn</a>
      </p>
    </div>
  );
}
